/* Обнуление ================================================================================ */
* {
  padding: 0;
  margin: 0;
  border: 0;
}

*,
*:before,
*:after {
  box-sizing: border-box;
}

:focus,
:active {
  outline: none;
}

a:focus,
a:active {
  outline: none;
}

nav,
footer,
header,
aside {
  display: block;
}

input,
button,
textarea,
select {
  font-family: inherit;
}

input::-ms-clear {
  display: none;
}

button {
  cursor: pointer;
}

button::-moz-focus-inner {
  padding: 0;
  border: 0;
}

a,
a:visited {
  text-decoration: none;
}

a:hover {
  text-decoration: none;
}

ul li {
  list-style: none;
}

img {
  vertical-align: top;
}

h1,
h2,
h3,
h4,
h5,
h6 {
  font-size: inherit;
  font-weight: 400;
}

textarea {
  resize: none;
}

/* Тело страницы ============================================================================= */
body {
  font-family: "";
  overflow-x: hidden;
}
body.lock {
  overflow: hidden;
  touch-action: none;
}

/* Оболочка ================================================================================== */
.wrapper {
  display: flex;
  flex-direction: column;
  min-height: 100vh;
}

/* Прижатие футера к низу*/
.wrapper > main {
  flex: 1 1 auto;
}

/* Контейнер ================================================================================= */
[class*=__container] {
  max-width: 1470px;
  margin: 0 auto;
  padding: 0 15px;
}
